import React, { useState } from 'react';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PhoneIcon from '@material-ui/icons/Phone';
import FavoriteIcon from '@material-ui/icons/Favorite';
import PersonPinIcon from '@material-ui/icons/PersonPin';
import HelpIcon from '@material-ui/icons/Help';
import ShoppingBasket from '@material-ui/icons/ShoppingBasket';
import ThumbDown from '@material-ui/icons/ThumbDown';
import ThumbUp from '@material-ui/icons/ThumbUp';



const Header = ()=>{
    const {value} = props;
    const [valuee, setValue] = useState(0);
    const ChangeTabs = (x)=>{
        console.log(x)
    }
    return (

        <AppBar position="sticky" color="default">
          <Tabs
            value={value}
            onClick = {ChangeTabs}
            variant="scrollable"
            scrollButtons="on"
            indicatorColor="primary"
            textColor="primary"
            aria-label="scrollable force tabs example"
          >
            <Tab label="Item One" icon={<PhoneIcon />} onClick= {ChangeTabs()} />
            <Tab label="Item Two" icon={<FavoriteIcon />}onClick= {ChangeTabs} />
            <Tab label="Item Three" icon={<PersonPinIcon />} onClick= {ChangeTabs}/>
            <Tab label="Item Four" icon={<HelpIcon />}  />
            <Tab label="Item Five" icon={<ShoppingBasket />} onClick= {ChangeTabs} />
            <Tab label="Item Six" icon={<ThumbDown />}onClick= {ChangeTabs} />
            <Tab label="Item Seven" icon={<ThumbUp />}onClick= {ChangeTabs} />
          </Tabs>
        </AppBar>

    );
  }
  export default Header;
